import React from 'react';
import ReactDOM from 'react-dom';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';

const mapStyles = {
    width: '100vh',
    height: '100%'
}
   
class Dashboard extends React.Component {
    static cityNames = [
        {
            name : 'Delhi',
            lat : '',
            lng : ''
        },
        {
            name : 'Mumbai',
            lat : '',
            lng : ''
        },
        {
            name : 'Kolkata',
            lat : '',
            lng : ''
        },
        {
            name : 'Channai',
            lat : '',
            lng : ''
        },
        {
            name : 'Pune',
            lat : '',
            lng : ''
        },
        {
            name : 'Bangalore',
            lat : '',
            lng : ''
        },
        {
            name : 'Hyderabad',
            lat : '',
            lng : ''
        },
        {
            name : 'Cochi',
            lat : '',
            lng : ''
        },       

    ];
    render() {
        
        const myNames = this.cityNames.map(name => {
            return (
                <li>{name.name}</li>
            );
        })
        return (
            <div>
                <div>Hello User </div>
                <div style={{width: '50%', float : "left"}}>Lists Of Cities
                <ul>
                    {myNames}
                </ul>
                </div>
                <div style={{width: '50%', float : "left" }}>
                <Map
                    google={this.props.google}
                    zoom={11}
                    style={mapStyles}
                    initialCenter={{ lat: 22.5726, lng: 88.3639 }}
                >
                    <Marker position={{ lat: 22.5726, lng: 88.3639 }} />
                </Map>
                </div>
            </div>
        );
    }
}
export default GoogleApiWrapper({
    apiKey: 'AIzaSyAwu42ZjnzWV4-LQe5-t72Ujt3OykdqZ_w'
  })(Dashboard);
